from Crypto.Util.number import long_to_bytes as lb , inverse as inv
from math import isqrt



#we can notice that the two choosen primes are close to each other wich makes it vulnerable to fermat attack 


def is_square(x):
    y = isqrt(x)
    return y if y ** 2 == x else None

def factorize(N):
    a = isqrt(N)
    b = a * a - N
    while b < 0 or not is_square(b):
        a += 1
        b = a * a - N
    p = a - isqrt(b)
    q = N // p
    return p, q if p * q == N else None

